const mainReducer = (
    state = {counter:0 , name:'' , age:''}, actionData) =>
{
    switch (actionData.type)
    {
        case 'INCREMENT':
        {
            return{counter:state.counter + actionData.delta}
        }
        case  'DECREMENT' :
        {
            return{counter:state.counter - actionData.delta}
        }
        case 'NAME':
        {
            return{name:state.name}
        }
        case 'AGE':
        {
            return{age:state.age}
        }

        default:
            return state
    }
};

export default mainReducer;
